INSERT INTO `news` (`id`, `title`, `description`, `category`, `file_path`, `uploaded_by`, `status`, `created_at`, `updated_at`) VALUES
	(4, 'This trait of disclosure is man’s instinctive quality', 'At the dawn of the creation, man intends to disclose himself to others. This trait of disclosure is man’s instinctive quality. “Khagrachari Police Lines High School” is contributing this gigantic task to fetch the hidden talent out of the tender hearted students taking part in co-educational process along with pragmatic timely academic education for the betterment of these backward communities to make themselves perfect citizen. This institution is playing a pioneer role to develop human resources upholding the actual scientific and technology based education method', 'Latest News', 'assets/images/blog/1566282249.jpg', 1, 1, '2019-03-20 08:10:43', '2019-08-20 06:24:09'),
	(5, 'KPLHS is working diligently to build up a skilled', 'W3 School was founded in 1992 as an English Medium school to provide a world class education for the students of Chittagong. Since those humble beginnings, the school has evolved to cater to the changing needs of young people in both Chittagong and the capital city of Dhaka. The school is known for its academic accomplishment in the British styled O and A levels but also as a designated examination centre for the SAT tests for U.S. college admissions. More recently, we have added the option for students to follow the Bangladesh National Curriculum. We believe that this option will cater to more specific needs and requirements of our pupils. We are very proud that unlike most academic institutions, W3 is in a position to offer this flexibility to our students. We believe that our National Curriculum option has allowed W3 to complete its journey to becoming a holistic academic institution, meeting the needs of students both at home and abroad. W3 fosters a common vision amongst all our students by celebrating diversity, Bangladeshi nationalism and by focusing on the pursuit of excellence in both academic as well as extra-curricular activities in order to develop young men and women who have a solid foundation to pursue any educational path as well as career in their future.', 'Latest News', 'assets/images/blog/1553069485.jpg', 1, 1, '2019-03-20 08:11:25', '2019-08-20 06:23:07'),
	(6, 'The institute’s commitment to the development of young students', 'Bangladesh has been moving towards with continuous development for the last two decades facing the increasing competition of this intensive competitive world begun from the 21st century. We already have joined the lower-middle income country category.\r\nThrough the implementation of vision 2021 the country continues to express its aspiration to join the middle income country by 2021 and also by 2041, expecting herself as a developed country Khagrachari Police Lines High School is working diligently to build up a skilled and meritorious human resources who are the crying need to achieve this goal.\r\nAfter a long tradition of a half decade period, we are now at the top list in various sectors in the region. The institute’s commitment to the development of young students through the preservation of religious values spirit of the liberation war, science and technology and also by practicing sports, literature and culture into them.\r\nKhagrachari Police Lines High School will move forward smoothly with the adaptation of a new idea of a day with tradition. As the president of the board of the directors, I want creative thinking and cooperation from all including the students, the teacher and the guardians also .', 'Notice Board', 'assets/images/blog/1566282066.jpg', 1, 1, '2019-03-20 09:30:21', '2019-08-20 06:21:06'),
	(7, 'KPLHS will move forward smoothly with the adaptation of a new idea.', 'Bangladesh has been moving towards with continuous development for the last two decades facing the increasing competition of this intensive competitive world begun from the 21st century. We already have joined the lower-middle income country category.\r\nThrough the implementation of vision 2021 the country continues to express its aspiration to join the middle income country by 2021 and also by 2041, expecting herself as a developed country Khagrachari Police Lines High School is working diligently to build up a skilled and meritorious human resources who are the crying need to achieve this goal.\r\nAfter a long tradition of a half decade period, we are now at the top list in various sectors in the region. The institute’s commitment to the development of young students through the preservation of religious values spirit of the liberation war, science and technology and also by practicing sports, literature and culture into them.\r\nKhagrachari Police Lines High School will move forward smoothly with the adaptation of a new idea of a day with tradition. As the president of the board of the directors, I want creative thinking and cooperation from all including the students, the teacher and the guardians also .', 'Notice Board', 'assets/images/blog/1566282035.jpg', 1, 1, '2019-03-20 09:31:14', '2019-08-20 06:21:41'),
	(8, 'Khagrachari Police Lines High School is working diligently to build up a skilled', 'Bangladesh has been moving towards with continuous development for the last two decades facing the increasing competition of this intensive competitive world begun from the 21st century. We already have joined the lower-middle income country category. Through the implementation of vision 2021 the country continues to express its aspiration to join the middle income country by 2021 and also by 2041, expecting herself as a developed country Khagrachari Police Lines High School is working diligently to build up a skilled and meritorious human resources who are the crying need to achieve this goal', 'Notice Board', 'assets/images/blog/1566281941.jpg', 1, 1, '2019-03-20 09:31:32', '2019-08-20 06:19:01'),
	(9, 'Real education aids our children to build up character and human life', 'Real education aids our children to build up character and human life. The main aim of education is to create human with human qualities. Khagrachari Police Lines High School has been published keeping the aim of making our children real human. When Poor and helpless people of this locality are deprived of quality education because of money right then this school has come up for those people as a hope of light', 'Notice Board', 'assets/images/blog/1566281856.jpg', 1, 1, '2019-03-20 09:31:55', '2019-08-20 06:17:36'),
	(10, '“Khagrachari Police Lines High School” is contributing this gigantic task to fetch', 'At the dawn of the creation, man intends to disclose himself to others. This trait of disclosure is man’s instinctive quality. “Khagrachari Police Lines High School” is contributing this gigantic task to fetch the hidden talent out of the tender hearted students taking part in co-educational process along with pragmatic timely academic education for the betterment of these backward communities to make themselves perfect citizen. This institution is playing a pioneer role to develop human resources upholding the actual scientific and technology based education method', 'Notice Board', 'assets/images/blog/1553074332.jpg', 1, 1, '2019-03-20 09:32:12', '2019-08-20 06:16:32');
